def pridict(model):
    device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
    model = model.to(device)

    model.eval()  # 预测模式

    # 文件头，一般就是数据名
    fileHeader = ["Image", "Id"]

    # 写入数据
    csvFile = open("submission.csv", "w")
    writer = csv.writer(csvFile)

    # 写入的内容都是以列表的形式传入函数
    writer.writerow(fileHeader)

    for root, dirs, files in os.walk("./test", topdown=False):
        for name in files:
            print(os.path.join(root, name))
            print(name)
            if name.endswith("jpg"):
                img = Image.open(os.path.join(root, name))
                # img = Image.open("./train/new_whale/0a0c1df99.jpg")
                print(img.mode)

                if img.mode == "L":
                    # img = np.concatenate((img, img, img), axis=-1)
                    img = img.convert("RGB")

                normalize = transforms.Normalize(mean=[0.485, 0.456, 0.406],
                                                 std=[0.229, 0.224, 0.225])
                transform = transforms.Compose([transforms.Resize(256),  # 重置图像分辨率
                                                transforms.CenterCrop(224),  # 中心裁剪
                                                transforms.ToTensor(), normalize, ])
                img = transform(img)

                img = img.unsqueeze(0)
                img = img.to(device)

                with torch.no_grad():
                    pred = model(img)
                    print(pred)
                # _, predicted = torch.max(pred, 1)  # 获取分类结果
                # print(torch.max(pred, 1))

                maxk = max((1, 5))  # 取top1准确率，若取top1和top5准确率改为max((1,5))
                _, predicted = pred.topk(maxk, 1, True, True)
                predicted = predicted.cpu().numpy()[0]
                predicted = list(predicted)
                print("predicted: ", predicted)
                # pred_idx = predicted[0]
                #
                # print('预测结果', classes[int(pred_idx)])
                # _res = [name, classes[int(pred_idx)]]
                top5 = [classes[int(i)] for i in predicted]
                top5_ = ''
                for i in top5:
                    top5_ = top5_ + " " + i
                _res = [name]
                _res.append(top5_.lstrip())
                print("res: ", _res)
                writer.writerow(_res)

    csvFile.close()


if __name__ == '__main__':
    model = MobileNetV2.MobileNetV2(width_mult=1, n_class=5005)
    model.load_state_dict(torch.load("model.pt"))
    pridict(model)
